  const instance = axios.create({
    baseURL: 'https://api.example.com'
  });

  return (
    <Fragment>   
      <Nav />
      <BrowserRouter>
      <div className="main-content">
        <Route />
      </div>
      </BrowserRouter>
    </Fragment>
  );
}

export default App;
